result:
.structure-container{
  color: #1D2133;

  .bg{
    background-color: #ffffff;
    border-radius: 6px;
    padding: 30px;
    height: 100%;
  }

  p{
    margin: 0;
  }

  .title{
    font-size: 16px;
    font-weight: 550;
  }

  .p-btn{
    text-decoration: underline;
    color: rgb(63, 106, 255);
    cursor: pointer;
    margin-left: 20px;
    display: inline-block;
  }

  .f-l{
    float: left;
  }

  .f-r{
    float: right;
  }

  .first-row{
    height: 100%;

    .company{
      height: 240px;
    }

    .department{
      margin-top: 15px;
      height: calc(100% - 255px);
    }

    .user-info{
      height: calc(100% - 260px);
    }

    .user-table{
      width: 100%;
      height: calc(100% - 60px);
      margin-top: 30px;
    }

    .role-info{
      margin-top: 15px;
      height: 245px;
    }

    .role-table{
      width: 100%;
      height: calc(100% - 30px);
      margin-top: 30px;
    }
  }

  .company-tree{
    height: calc(100% - 20px);
    margin-top: 40px;
    overflow-y: auto;
  }

  .company-info-btn{
    margin-top: -8px;
  }

  .add-company-dlg{
    width:90%;
    margin: auto;

    .el-form-item{
      margin-bottom: 20px;
    }
  }

  .dialog-footer{
    width: 100%;
    display: flex;
    justify-content: space-around;
    padding: 0 15% 15px;
  }

  .auth-dlg{
    height: 100%;

    .auth-wapper{
      position: relative;
      height: 450px;

      .auth-edit-btn{
        position: absolute;
        left: 0;
        right: 0;
        bottom: 5px;
        margin: auto;
      }
    }
  }
}
